import './App.css';







function App() {
  $(window).scroll(function() {
    var scroll = $(window).scrollTop();
    if (scroll > 100) 
      $("#drop").addClass("active");
    else if (scroll < 80) 
      $("#drop").removeClass("active");
  });

  $("#drop, nav ~ ul li").click(function() {
    $("nav, #drop span").toggleClass("open");
    $("body").toggleClass("hidden");
    $(window).scrollTop(0); //cheating
  });


  return (
    <>
    <div class="wrapper">
        <nav>
          <div id="drop">
            <div>
             <span></span>
             <span></span>
            <span></span>
           </div>
          </div>
        </nav>
     <ul>
       <li>home</li>
        <li>about</li>
      <li>login</li>
      <li>contact</li>
      <li>privacy</li>
     </ul>

  </div>
    </>
  );
}

export default App;
